export default function Menu() {
    return (
        <menu className="menu text-light opacity-3">
            <div className="menu-content"><p>Tableware</p></div>
            <div className="menu-content"><p>Cookware</p></div>
            <div className="menu-comtent"><p>Home accessoreies</p></div>
            <div className="menu-comtent"><p>Lighting</p></div>
            <div className="menu-comtent"><p>Textile</p></div>
            <div className="menu-comtent"><p>Furniture</p></div>
        </menu>
    );
}
